import React from 'react'
import LogInPage from './LogInPage'

class Main extends React.Component{

  constructor(props: any){
    super(props)
    this.state = {
      isLoggedIn: false
    }
  }

  render(){
    return (
      <div className="App">
        {this.state.isLoggedIn ? <LogiInPage/> : <InterfacePage/>}
      </div>
    );
  }
}

export default Main
